import React from "react";
import {Card} from "react-bootstrap";
import "./EnemyIcon.css";

const EnemyIcon = ({ enemy }) => {
  return (
    <Card className='enemy-icon-container'>
      
        <div className="text"> About to Play</div>
        <div className="skill" style={{ color: "black" }}>
          BrianMinhNguyen
        </div>
      
    </Card>
  );
};

export default EnemyIcon;
